import {
  Directive,
  ElementRef,
  HostBinding,
  HostListener,
  Input,
} from '@angular/core';

@Directive({
  selector: 'img[libImgFallback]',
  standalone: true,
})
export class ImgFallbackDirective {
  @Input() libImgFallback!: string;
  @HostBinding('class.loading') isLoading = true;
  @HostBinding('class.error') hasError = false;

  private fallbackAttempts = 0;
  private readonly maxAttempts = 3;

  @HostListener('error')
  onError() {
    this.handleImageError();
  }

  @HostListener('load')
  onLoad() {
    this.isLoading = false;
    this.hasError = false;
  }

  constructor(private el: ElementRef<HTMLImageElement>) {}

  private handleImageError() {
    const element = this.el.nativeElement;

    this.isLoading = false;
    this.hasError = true;

    if (this.fallbackAttempts < this.maxAttempts) {
      this.fallbackAttempts++;

      // Try loading the fallback image
      element.src = this.libImgFallback;
    } else {
      // If all attempts fail, set to a data URI of a minimal placeholder
      element.src = `data:image/jpeg;base64,`;
    }
  }
}
